String _str(dynamic v) { if (v is double && v == v.roundToDouble()) { return v.toInt().toString(); } return v.toString(); }

int parse_int(String s) {
  int value = 0;
  int i = 0;
  while (i < s.length) {
    String c = s.substring(i, i + 1);
    value = value * 10 + ((c).codeUnitAt(0));
    i = i + 1;
  }
  return value;
}

String join(List<String> xs) {
  String s = "";
  int i = 0;
  while (i < xs.length) {
    s = s + xs[i];
    i = i + 1;
  }
  return s;
}

bool contains(List<String> xs, String c) {
  int i = 0;
  while (i < xs.length) {
    if (xs[i] == c) {
    return true;
  }
    i = i + 1;
  }
  return false;
}

int index_of(List<String> xs, String c) {
  int i = 0;
  while (i < xs.length) {
    if (xs[i] == c) {
    return i;
  }
    i = i + 1;
  }
  return -1;
}

List<String> remove_at(List<String> xs, int idx) {
  List<String> res = <String>[];
  int i = 0;
  while (i < xs.length) {
    if (i != idx) {
    res = (res..add(xs[i]));
  }
    i = i + 1;
  }
  return res;
}

List<String> unique_chars(List<String> logins) {
  List<String> chars = <String>[];
  int i = 0;
  while (i < logins.length) {
    String login = logins[i];
    int j = 0;
    while (j < login.length) {
    String c = login.substring(j, j + 1);
    if (!chars.contains(c)) {
    chars = (chars..add(c));
  }
    j = j + 1;
  }
    i = i + 1;
  }
  return chars;
}

bool satisfies(List<String> permutation, List<String> logins) {
  int i = 0;
  while (i < logins.length) {
    String login = logins[i];
    int i0 = index_of(permutation, login.substring(0, 0 + 1));
    int i1 = index_of(permutation, login.substring(1, 1 + 1));
    int i2 = index_of(permutation, login.substring(2, 2 + 1));
    if (!(i0 < i1 && i1 < i2)) {
    return false;
  }
    i = i + 1;
  }
  return true;
}

String search(List<String> chars, List<String> current, List<String> logins) {
  if (chars.length == 0) {
    if (satisfies(current, logins)) {
    return join(current);
  };
    return "";
  }
  int i = 0;
  while (i < chars.length) {
    String c = chars[i];
    List<String> rest = remove_at(chars, i);
    List<String> next = (current..add(c));
    String res = search(rest, next, logins);
    if (res != "") {
    return res;
  }
    i = i + 1;
  }
  return "";
}

int find_secret_passcode(List<String> logins) {
  List<String> chars = unique_chars(logins);
  String s = search(chars, <String>[], logins);
  if (s == "") {
    return -1;
  }
  return parse_int(s);
}

